import React from "react";
import { Menu } from 'semantic-ui-react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

export class NavMenu extends React.Component{
    render(){
        return(
            <Menu inverted>
                <Link to="/">
                <Menu.Item
                    name='home'/>
                </Link>

                <Link to="/github">
                <Menu.Item
                    name='github commits :)'/>
                </Link>
          </Menu>
        )
    }
}
